    if(subPage  == "Game-CreateAvatar" )
         return <></>


    return(
        <>
            <Header position="1,1|50,7" border>

            </Header>

            <AvatarCreatorView gender="boy"/>
 
            <Grid>

            </Grid>

            <Copyright />
        </>
    )

});

